import CarBrowsing from "./CarBrowsing";

function filterCars(selectedCategory, selectedSubCategory) {
    const result = CarBrowsing.cars.filter((curCar) => {
        return curCar.category === selectedCategory && curCar.seats === selectedSubCategory
    });
    CarBrowsing.setCars(result);
}

export default filterCars;
